function getLocation(){if(navigator.geolocation)navigator.geolocation.getCurrentPosition(showPosition,showError);else{var o=document.getElementById("locationError");o.style.display="block"}}function showPosition(o){console.log("showPosition I am in action");o.coords.latitude+","+o.coords.longitude;console.log(o.coords.latitude+" "+o.coords.longitude),document.getElementById("location").value=o.coords.latitude+", "+o.coords.longitude}function showError(o){var e=document.getElementById("status");switch(e.style.color="red",o.code){case o.PERMISSION_DENIED:e.innerHTML="Denied the request for Geolocation. Maybe, ask the user in a more polite way?";break;case o.POSITION_UNAVAILABLE:e.innerHTML="Location information is unavailable.";break;case o.TIMEOUT:e.innerHTML="The request to get location timed out.";break;case o.UNKNOWN_ERROR:e.innerHTML="An unknown error occurred :("}}$(document).foundation(),$(function(){$("#dateOne").fdatepicker({format:"mm-dd-yyyy hh:ii",disableDblClickSelection:!0,pickTime:!0}),$("#dateTwo").fdatepicker({format:"mm-dd-yyyy hh:ii",disableDblClickSelection:!0,pickTime:!0})});